        <div style = {{textAlign: "center"}}>
            <h1 style = {{textDecoration: "underline"}}>ABOUT</h1>
            <h3 style = {{margin: "20px 20%"}}>If you're seeing this text, then the about section of the forum has not been created by the owner! 4UM is a software designed to be customizable for any needs, with customizations such as changing the logo, colors, and forum name. Please consult the configuration file in the source folder of your forum to edit.</h3>
        </div>
    );
}

export default About
